import "./App.css";
import "./bulma/css/bulma.min.css";
import Nav_Bar from "./components/NavBar";
import What_We_Do from "./components/WhatWeDo";
import Hero_JM from "./components/Hero";
import Case_Studies_Slider from "./components/CaseStudiesSlider";
import Footer_JS from "./components/Footer";
import TrustedLeadingBrands from "./components/TrustedLeadingBrands";

const App = () => {
  return (
    <div>
      <div>
        <header>
          <Nav_Bar />
        </header>
        <body>
          <Hero_JM />
          <What_We_Do />
          <Case_Studies_Slider />
          <TrustedLeadingBrands />
        </body>
        <footer>
          <Footer_JS />
        </footer>
      </div>
    </div>
  );
};

export default App;
